import TableBody from './TableBody';
import TableFooter from './TableFooter';

export function Table () {
return (
    <>
    <table id="table_select_item" className="table table-striped">
    <TableHeader />
    <TableBody />
    </table>
    <TableFooter />
    </>

)
}
